inline cFont *NEW_CFONTCALIBRI32()
{
    cImage        *img       = new cImage(CFONTCALIBRI32_WIDTH, CFONTCALIBRI32_HEIGHT, CFONTCALIBRI32_IMAGE_FORMAT);
    unsigned char *bytearray = new unsigned char[CFONTCALIBRI32_IMAGE_SIZE];

    memcpy(bytearray, CFONTCALIBRI32_BYTEARRAY, CFONTCALIBRI32_IMAGE_SIZE);
    img->setData(bytearray, CFONTCALIBRI32_IMAGE_SIZE, true);

    cFont *font = new cFont();
    font->m_charset.m_base       = CFONTCALIBRI32_CHARSET_BASE;
    font->m_charset.m_lineHeight = CFONTCALIBRI32_CHARSET_LINEHEIGHT;
    font->m_charset.m_width      = CFONTCALIBRI32_WIDTH;
    font->m_charset.m_height     = CFONTCALIBRI32_HEIGHT;
    font->m_charset.m_pages      = CFONTCALIBRI32_CHARSET_PAGES;
    for (int i=0; i<256; i++)
    {
        font->m_charset.m_chars[i].m_x        = CFONTCALIBRI32_CHARSET[8*i  ];
        font->m_charset.m_chars[i].m_y        = CFONTCALIBRI32_CHARSET[8*i+1];
        font->m_charset.m_chars[i].m_width    = CFONTCALIBRI32_CHARSET[8*i+2];
        font->m_charset.m_chars[i].m_height   = CFONTCALIBRI32_CHARSET[8*i+3];
        font->m_charset.m_chars[i].m_xOffset  = CFONTCALIBRI32_CHARSET[8*i+4];
        font->m_charset.m_chars[i].m_yOffset  = CFONTCALIBRI32_CHARSET[8*i+5];
        font->m_charset.m_chars[i].m_xAdvance = CFONTCALIBRI32_CHARSET[8*i+6];
        font->m_charset.m_chars[i].m_page     = CFONTCALIBRI32_CHARSET[8*i+7];
    }
    font->m_charset.preProcess();

    font->m_texture->setImage(img);

    return font;
}

